    <div className="content">
      <div
        className="errorPage__title"
        style={{
          fontSize: "5rem",
          textTransform: "uppercase",
          fontWeight: "bold",
          color: "var(--bg-btn-pink)",
        }}
      >
        This page is not available
      </div>
    </div>
  );
}
